import React from "react";
import { Card } from "../Card";
import styled from "styled-components";

const Row = styled.div`
   display: flex;
   flex-direction: row;
`;

const Column = styled.div`
   display: flex;
   flex-direction: column;
`;

type Flight = {
    ident: string,
    departuretime: number,
    arrivaltime: number,
    readable_departure: string,
    readable_arrival: string,
    origin: string,
    destination: string,
} 


type Props = {
    flight: Flight,
    onDragStart,
} 


const FlightCard = ({ flight, onDragStart} : Props) => {
    const { ident,
            readable_departure,
            readable_arrival,
            origin,
            destination } = flight;

    return (
        <Card onDragStart={onDragStart} draggable={true}>
            <p>{ident}</p>
            <Row>
                <Column>
                    <p>{readable_departure}</p>
                    <p>{origin}</p>
                </Column>
                <Column>
                    <p>{readable_arrival}</p>
                    <p>{destination}</p>
                </Column>
            </Row>
        </Card>);
};

export default FlightCard;
